Job Description:
Assist Legislative Assistants by researching and tracking controversial issues and public policy;
Draft issue statements and speaking points;
Track committee meetings, stakeholder interests, and issues pertaining to various constituents;
Compile information and data using Microsoft Office or other related programs;
Organize and track email and other correspondence for review/response from Legislative Assistants;
Compose routine or recurring correspondence as instructed and reviewed by Legislative Assistants;
Answer and direct phone calls to relevant parties;
Assist constituents visiting the office;
Prepare Council Committee notebooks;
Process incoming mail; and,
Perform other related duties or assist with special projects as assigned by Councilmember or Legislative Assistants.

Experience:
A working proficiency with computers and software skills such as Microsoft Office (Outlook, Word, and Excel);
Good written and verbal communication skills and phone etiquette;
Customer service skills;
Internet research skills;
Punctuality and reliability; and,
Ability to use photocopiers, scanners, and other office equipment.

