Contribute as a key member of an agile team that develops, implements, and manages operational and analytic data pipelines in support of individual customer needs, ongoing operations, and software project investments;

Collaborate effectively on diverse teams (e.g., Portfolio / Project managers, domain experts, users, and software engineering team) to design and deploy innovative data solutions in support of business information systems across the enterprise;

Provide individual and collaborative contributions to software development and analytic projects across a broad range of technologies and subject areas;

Develop and Demonstrate domain expertise, foster a healthy culture of innovation and an ethical code of conduct.

Meet expectations and standards for quality, safety, and security.

Build strong relationships with peers, upper management, and other relevant internal/external stakeholders.

Assimilate knowledge quickly in a variety of domains;

Continuously scanning the technology landscape for new approaches and methods to achieve results that can be incorporated into the enterprise;

Provide customers with a professional experience when requesting application development and support.

Effectively work with technical resources of various skills to achieve development and operations objectives, maintaining current skills and capabilities, and ensuring adequate cross-training on product expertise.

Manage the adoption and adaptation of emerging technologies to meet changing business requirements and opportunities.
